import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import Googleicon from '../../images/googlemap.png';

export function GoogleIcon (props) {
  return (
    <SvgIcon
      component="span"
      sx={{
        transform:' translate(-50%, -50%)',
        transform: props.checked ? "scale(0.800000,-0.800000)" : "scale(1,-1)",
        scale : props.checked ? 100 : 80
        }}>
      <img src={Googleicon} alt="ロゴ" width="50" height="50"></img>
    </SvgIcon>
  );
};
